import React from "react";
import notes from "../notes";

notes.map(noteEntry =>{
    return(
        <div className = "note">
            <h1>{noteEntry.title}</h1>
            <p>{noteEntry.content}</p>
        </div>
    );
});
function Note(){
    return <div className = "note">
        <h1>Title</h1>
        <p>This is the content!.</p>
    </div>;
}

export default Note ;
